export function getWordOfTheDay(today: number) {
  const startDay = Math.floor((Number(new Date(2022, 0, 24)) + 1000 * 60 * 60 * 2) / (1000 * 60 * 60 * 24));
  let day = today - startDay;
  while (day > answers.length) {
    day -= answers.length;
  }
  return answers[day];
}

